/** @jsxImportSource @emotion/react */
import styled from "@emotion/styled";
import React from "react";
import { FaGithub, FaLinkedinIn, FaMediumM, FaInstagram } from "react-icons/fa";

const StyledIconHeader = styled.p`
  color: #aeff00;
  font-family: Kanit-Thin-Italic;
  transform: rotate(-90deg);
  padding: 10px;
`;

function AboutIcons() {
  return (
    <div style={{ color: "#aeff00", display: "flex"}}>
      <div className="linkedinIconContainer" style={{display: "flex"}}>
        <StyledIconHeader>LinkedIn</StyledIconHeader>
        WORK EXP.
        <FaLinkedinIn size={70} style={{color: 'black' }}/>
      </div>
      <div className="githubIconContainer" style={{display: "flex"}}>
        <StyledIconHeader>Github</StyledIconHeader>
        <p>PROJECTS</p>
        <FaGithub size={70} style={{color: 'black', position: 'absolute', marginLeft: '110px' }}/>
      </div>
      <div className="mediumIconContainer" style={{display: "flex"}}>
        <StyledIconHeader>Medium</StyledIconHeader>
        BLOG
        <FaMediumM size={70} style={{color: 'black' }}/>
      </div>
      <div className="instagramIconContainer" style={{display: "flex"}}>
        <StyledIconHeader>Instagram</StyledIconHeader>
        PERSONAL
        <FaInstagram size={70} style={{color: 'black'}}/>
      </div>
    </div>
  );
}

export default AboutIcons;
